Posted @withrepost • @coreyscauldron I hope your day is going wonderfully! 

For this afternoon, we have a nice lineup for your viewing pleasure. Don’t forget to check out my YouTube page (link in my bio).

Pulling from the archives of @thewitchofwonderlust once again, this time on sigil making! With the winter holidays around the corner, sigils may be a great thing to incorporate into your practice!

@chaoticwitchaunt talks about how they protect themselves as a witch in the internet. Protecting yourself is one of the most important practices we partake in, in my opinion. Seeing how others do theirs is always a fun time for me!

@madamepamita talks about Slavic Hair Magic, episode 9 of their podcast! This is available on Spotify to listen, or YouTube to watch!

A lot of times, we talk about trusting the universe to provide. @from.far.out talks about how to surrender and trust Spirit, a difficult practice that can be made easier by tools of the craft.

@the_witches_cookery provides some wonderful things to warm up your hearth, home, and belly!! Check out their video for some great ideas for Yule activities. Apples are involved 🤤

