Do you have tickets for The December Cancer Full Moon Workshop: The Wheels of the Year?!

Yes, the WHEELS of the Year – that’s no typo! There are many wheels of the year that were celebrated by people in ancient times.

In this workshop, we’ll be focusing on:
✦  The original Celtic and Germanic sources for the traditional Wiccan Wheel of the Year;
✦  Looking at the Slavic Wheel of the Year;
✦  Touching on seasonal celebrations in non-European cultures that have pagan roots;
✦  Tapping into the power of these magical timings for amplifying our spellwork in the 21st century;
✦  Seasonal specific spells and rituals that you can easily incorporate into your practice to empower your magic.
And More! 

It all happens on December 26 at 6PM PT/7PM MT/8PM CT/9PM ET!

Everyone who registers will receive a recording after. No magical experience is necessary and people of all spiritual paths are welcome!

Get tickets (or subscribe to the whole series and save!) by heading to Parlourofwonders.com, clicking Shop, and then selecting Full Moon Workshops!

